import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";
import App from "./App";
import { Route } from "react-redux";


const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <Route>
    <React.StrictMode>
      <App />
    </React.StrictMode>
  </Route>
);
